import Link from 'next/link';

type ArticleProps = {
  title: string;
  id: string;
}

export const Article = ({ title, id }: ArticleProps) => (
  <li>
    <Link href={`/articles/[id]`} as={`/articles/${id}`}>
      <a>{title}</a>
    </Link>
  </li>
)

export default Article
